//check if 'val' is in 'set' whose size is 'setsize'
int isinset(int val, int set[], int setsize){
    int i;
    int flag = 0;
    for(i = 0; i < setsize; i++){
        if(val == set[i]){
            flag = 1;
        }
    }
    return flag;
}
